  "text" : "\uAD6C\uAE00\uC758 \uC0AC\uC6A9\uC131\uC740 \uC808\uB300 \uD3B8\uD558\uC9C0 \uC54A\uB2E4. \uADF8\uB807\uB2E4\uACE0 \uCE5C\uC808\uD558\uC9C0\uB3C4 \uC54A\uB2E4. \uD558\uC9C0\uB9CC \uBD84\uBA85\uD55C \uAC83\uC740 \uD55C\uBC88 \uBC30\uC6B0\uBA74 \uB450\uACE0 \uB450\uACE0 \uC6B0\uB824\uBA39\uC744 \uC218 \uC788\uACE0 \uC27D\uAC8C \uC78A\uD600\uC9C0\uC9C0\uAC00 \uC54A\uB290\uB2E4. \uADF8\uB7F0\uB370 \uC6B0\uB9AC \uB098\uB77C\uB294 \uAC1C\uD3B8 \uC5C5\uB370\uC774\uD2B8\uB294 \uACF5\uD3EC\uC5D0 \uAC00\uAE5D\uB2E4 \uBAA8\uB4E0\uAC78 \uC0C8\uB85C \uBC30\uC6CC\uC57C\uB9CC \uD55C\uB2E4. \uC263....",
