  "text" : "\uAD6C\uAE00\uC758 \uC0AC\uC6A9\uC131\uC740 \uD3B8\uB9AC\uD568, \uCE5C\uC808\uD568 \uBCF4\uB2E4\uB294 \uC2E0\uB8B0\uC131, \uAC04\uACB0\uD568, \uC77C\uAD00\uC131\uC73C\uB85C \uB300\uD45C\uB41C\uB2E4\uACE0 \uC0DD\uAC01\uB41C\uB2E4. \uADF8\uB9AC\uACE0 \uBB34\uC5C7\uBCF4\uB2E4 \uC7AC\uCE58\uAC00 \uB118\uCE5C\uB2E4. \uAD6C\uAE00\uC740 \uB9E5\uB77D\uC5D0 \uB530\uB77C \uC0DD\uAC01\uD558\uB294 \uC6B0\uB9AC\uC758 \uB1CC\uAD6C\uC870\uB97C \uB9E4\uC6B0 \uD6CC\uB96D\uD558\uAC8C \uCEF4\uD4E8\uD130 \uC704\uC5D0 \uAD6C\uD604\uD558\uB294 \uB2A5\uB825\uC744 \uBCF4\uC5EC\uC8FC\uACE0 \uC788\uB2E4.",
