  "text" : "\uAD6C\uAE00\uC774 \uB9D0\uD558\uB294 \uBCA0\uD0C0\uB77C\uB294 \uAC83\uC740 \uACE0\uAC1D\uC758 \uC758\uACAC\uC744 \uBC1B\uC544\uB4E4\uC5EC \uC0AC\uC6A9\uC131\uC744 \uAC1C\uC120\uD55C\uB2E4\uB294 \uC758\uBBF8\uBCF4\uB2E4\uB294 \uC0AC\uC6A9\uC790\uAC00 \uAD6C\uAE00\uC758 UX\uB97C \uD559\uC2B5\uD558\uB294 \uD559\uC2B5\uAE30\uAC04\uC758 \uC758\uBBF8\uAC00 \uB354 \uD06C\uB2E4\uACE0 \uC0DD\uAC01\uD55C\uB2E4. \uBB38\uC81C\uB294 \uD55C\uBC88 \uD559\uC2B5\uD558\uBA74 \uC808\uB300 \uD5E4\uC5B4\uB098\uC62C\uC218\uAC00 \uC5C6\uB2E4. \uB2E4\uB978 \uBAA8\uB4E0 \uC11C\uBE44\uC2A4\uC758 UI\uB294 \uBD88\uD3B8\uD558\uAE30\uC774 \uADF8\uC9C0 \uC5C6\uB2E4.",
